import React from "react";

//Styles


//images
import mvmIcon from "../images/1x/mvmIcon.png";
import mvmIcon2x from "../images/2x/mvmIcon@2x.png";
import mvmIcon3x from "../images/3x/mvmIcon@3x.png";


function Header(){
    return(
        <header>
            
            <div className="header-container">
                <img className="mvmIcon" srcSet={`${mvmIcon} 1x, ${mvmIcon2x} 2x, ${mvmIcon3x} 3x`} src={mvmIcon} alt="mvmIcon"/>

                <p>Custommer Support</p>
            </div>

        </header>
    );
}

export {Header};
